import React from 'react';
import {PopupContent} from "../components/PopupContent"

import { useState } from 'react';

interface CardProps {
  id:number,
  imageBuyer: string;
  buyer: string;
  seller: string;
  imageSeller: string;
  unitcost: string;
  xirr: string;
  totalunit:string;
  remainingunit:string;
  tenure: string;
}

export const CardComponent: React.FC<CardProps> = ({
    id,
  imageBuyer,
  buyer,
  seller,
  imageSeller,
  unitcost,
  xirr,
  totalunit,
  remainingunit,
  tenure
}) => {
    const [modelOpen , setModel]=useState(false);
  return (
    <div className="w-80 h-72 shadow rounded-2xl bg-white px-4 py-4">
      <div className="flex justify-between">
        <div className="flex items-center w-80 h-16">
          <img className="h-12 w-12 object-cover object-center" src={imageBuyer} alt="Buyer" />
          <div className="ml-2">
            <p className="text-gray-400 text-xs font-medium">Buyer</p>
            <p className="font-medium text-sm">{buyer}</p>
          </div>
        </div>
        <div className="flex items-center">
          <div className="mr-2 text-right">
            <p className="text-gray-400 text-xs font-medium">Seller</p>
            <p className="font-medium text-sm">{seller}</p>
          </div>
          <img className="h-12 w-12 object-cover object-center bl-3" src={imageSeller} alt="Seller" />
        </div>
      </div>
     
      <div className="grid grid-cols-2 divide-x divide-gray-200 px-1 py-5">
         <div>
            <p className="text-gray-400 text-xs font-medium">Units cost</p>
            <p className="font-medium text-sm"> â‚¹ {unitcost}</p>
          </div>
          <div className='text-right'>
            <p className='text-gray-400 text-xs font-medium'>XIRR</p>
            <p className='font-medium text-sm'>{xirr}</p>
         
          </div>
  
      </div>
      <div className='grid grid-cols-3 px-1 '>
        <div>
        <p className='text-gray-400 text-xs font-medium '>Unit left</p>
        <p  className='font-medium text-sm'>{remainingunit}/{totalunit}</p>
        </div>
        <div className='flex'>
            <button className='w-16 h-7 rounded-lg hover:bg-gray-700 hover:text-white  bg-gray-300 text-black text-center font-bold'>+</button>
            <div className='w-36 h-7 border rounded-lg mx-1 font-medium' >
          
               
            </div>
            <button className='w-16 h-7 rounded-lg hover:bg-gray-700 hover:text-white bg-gray-300 text-black text-center font-bold'>-</button>
        </div>
        <div className='text-right'>
            <p className='text-gray-400 text-xs font-medium ' >Tenure</p>
            <p className='font-medium text-sm'>{tenure} Days</p>
        </div>
        
      </div>
      <div className='flex justify-center pt-4'>
     
        <button onClick={()=>{ 
            setModel(true);
            if(modelOpen)
            <PopupContent/>
        } } className='w-64 h-12  rounded-lg hover:bg-gray-700 hover:text-white bg-gray-300 text-black text-center font-bold ' >BUY NOW</button>
   
          
      </div>
    
    </div>
  );
};
